create table dormitory
(
    id                    int auto_increment
        primary key,
    dormitory_id          int                                null,
    building_id           int                                null,
    floor                 int                                null,
    dormitory_name        varchar(255)                       null,
    total_capacity        int                                null,
    current_capacity      int      default 0                 null,
    in_gender             tinyint                            null,
    dormitory_direction   tinyint                            null,
    dormitory_description varchar(255)                       null,
    version               bigint   default 0                 null,
    target_resident       json                               null,
    update_time           datetime default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP,
    create_time           datetime default CURRENT_TIMESTAMP null,
    v_resident_id         varchar(255) as (json_extract(`target_resident`, '$[*].residentId')),
    constraint dormitory_dormitory_id_uindex
        unique (dormitory_id),
    constraint dormitory_v_resident_id_uindex
        unique (v_resident_id)
);

